{%- set data_ns = namespace(log = [], status = 0) -%}
{%- for key, value in CTX()|items -%}
    {%- if key.startswith("log_") -%}
        {%- set entry = value %}
        {%- do entry.update({"task": key|replace("log_", "")}) -%}
        {%- do data_ns.log.append(entry) -%}
    {%- endif -%}
{%- endfor -%}

{%- macro status_code() -%}
    {%- set data_ns.status = [entry.status_code|d(0) for entry in data_ns.log]|sort(true)|first
    or 2000 -%}
    {%- if data_ns.status  > 1000 and data_ns.status  < 2000 -%}
        {%- set data_ns.status = 1001 -%}
    {%- elif data_ns.status > 2000 -%}
        {%- set data_ns.status = 2000 -%}
    {%- endif -%}
    {{- data_ns.status -}}
{%- endmacro -%}

{%- macro succeeded() -%}
    {{- data_ns.status < 2000  -}}
{%- endmacro -%}

{%- macro data() -%}
    {%- set data = {} -%}
    {%- for entry in data_ns.log -%}
        {%- if entry.data|d({}) or {} != {} -%}
            {%- do data.update(entry.data) -%}
        {%- endif -%}
    {%- endfor -%}
    {{- data or None -}}
{%- endmacro -%}

{%- macro warnings() -%}
{{-
    [
        entry for entry in data_ns.log
            if entry.status_code|d(0) > 1000 and entry.status_code|d(0) < 2000
    ]
-}}
{%- endmacro -%}

{%- macro errors() -%}
{{-
    [
        entry for entry in data_ns.log
            if entry.status_code|d(0) >= 2000
    ]
-}}
{%- endmacro -%}

{{-
    {
        "status_code": status_code(),
        "succeeded": succeeded(),
        "data": data(),
        "errors": errors(),
        "warnings": warnings(),
        "entries": data_ns.log
    }
-}}

{% set output = [] %}
{% set top_level_msg = CTX.ticket_automation_log.errors | map(attribute="message") | list | flatten %}
{% do output.append([msg for msg in top_level_msg if msg != ""]) %}
{% set sub_msg = [data for data in CTX.ticket_automation_log.errors if data.sub_automation_log] | map(attribute="sub_automation_log") | list | flatten | map(attribute="entries") | list | flatten | map(attribute="message") | list | flatten%}
 {% do output.append([msg for msg in sub_msg if msg != ""]) %}
{%- for data in output | flatten -%}
{{- data + "\n" -}}
{%- endfor -%}

You are a helpful assistant who categorizes tickets for an MSP supporting external clients with their IT issues or requests.

{%if CTX.defined_psa|d == "halo_psa"%}
Categorize the ticket based on mappings:
{{ CTX.association_csv }}

Issue Summary: {{ CTX.message }}

Instructions:

Review: Ignore signatures/disclaimers. Focus on the issue.
Assign Categories:
Select one unique category per level (category:1, category:2, etc.).
Include at least one "category:1".
Return a json array with objects just like this example:
{
  "categories":[
    {
      "category": 1,
      "category_name": "Name from list",
      "category_id": "ID from list",
      "reason": "Brief explanation."
    }
  ]
}
{%else%}
Categorize the ticket based on mappings:
{{ CTX.association_csv }}

Issue Summary: {{ CTX.message }}

Instructions:

Review: Ignore signatures/disclaimers. Focus on the issue.
Select the best mapping for the issue based only on the provided details.

Respond with a JSON object in this format and always include a type_id:

  {
    "type_id": <integer>, // Required
    "subType_id": <integer>, // Optional, but requires the associated type_id to be present
    "item_id": <integer>, // Optional, but requires both the associated subType_id and type_id to be present
    "reason": "<string>" // Required
  }

Reason should clearly explain the choice, including the associated ID names, but must exclude the numeric ID values.
Do not justify missing fields or assume unprovided details.

Example json below
  {
    "type_id": 197,
    "subType_id": 11,
    "item_id": 3,
    "reason": "The issue relates to insufficient disk space, best addressed by file cleanup."
  }

If no mappings are appropriate:

Leave type_id, subType_id and item_id as null.
Provide a reason why nothing can be mapped.

{%endif%}

